            var canvas = document.getElementById("canvas");

            var Turtle = function (x, y, dir) {
                this.x = x;
                this.y = y;
                this.dir = dir;
                this.pen = true;
            }

            Turtle.prototype.show = function () {
                context.fillStyle = "White";
                context.beginPath();
                context.moveTo(this.x, this.y);
                context.lineTo(this.x - 10 * Math.cos((this.dir) - Math.PI / 10), this.y - 10 * Math.sin((this.dir) - Math.PI / 10));
                context.moveTo(this.x, this.y);
                context.lineTo(this.x - 10 * Math.cos((this.dir) + Math.PI / 10), this.y - 10 * Math.sin((this.dir) + Math.PI / 10));
                context.lineTo(this.x - 10 * Math.cos((this.dir) - Math.PI / 10), this.y - 10 * Math.sin((this.dir) - Math.PI / 10));
                context.fill();
            }

            Turtle.prototype.update = function (amt) {
                context.strokeStyle = "White";
                context.lineWidth = 1;
                if (this.pen) {
                    context.beginPath();
                    context.moveTo(this.x, this.y);
                    context.lineTo(this.x + Math.cos(this.dir) * amt, this.y + Math.sin(this.dir) * amt);
                    context.stroke();
                }
                this.x += Math.cos(this.dir) * amt;
                this.y += Math.sin(this.dir) * amt;
            }

            Turtle.prototype.changeAngle = function (angle) {
                this.dir -= (angle / 360) * (2 * Math.PI);
            }

            var Token = function (name, value, commands) {
                this.name = name;
                this.value = value;
                this.commands = commands;
            }

            function findRepeat (prog, id) {
                var bias = 0;
                var current = "";
                var block = true;
                for (var i = id;i < prog.length;i++) {
                    if (prog[i] != " ") {
                        block = false;
                    }
                    if (!block) {
                        current += prog[i];
                    }
                    if (prog[i] == "[" || (i == id + 3 && bias == 0)) {
                        bias++;
                    } else if (prog[i] == "]" || i == prog.length - 1) {
                        if (bias <= 1 || i == prog.length - 1) {
                            break;
                        }
                        bias--;
                    }
                }
                return current;
            }

            function findRepeatEnd (prog, id) {
                var bias = 0;
                var end = 0;
                for (var i = id;i < prog.length;i++) {
                    if (prog[i] == "[" || (i == id + 3 && bias == 0)) {
                        bias++;
                    } else if (prog[i] == "]" || i == prog.length - 1) {
                        if (bias <= 1 || i == prog.length - 1) {
                            end = i;
                            return end;
                            break;
                        }
                        bias--;
                    }
                }
                return end;
            }

            var Parser = function (prog) {
                this.prog = prog;
                this.id = 0;
            }

            Parser.prototype.parse = function () {
                this.name = "";
                this.val = "";
                this.coms = [];
                this.step = 0;
                this.check = false;
                this.jump = false;
                this.tks = [];
                for (var i = 0;i < this.prog.length;i++) {
                    i = this.id;
                    if (this.prog[i] == " " || this.check || this.prog[i] == '[' || this.prog[i] == ']' || this.name == "podnieś" || this.name == "upuść") {
                        if (this.step == 1) {
                            this.check = true;
                            if (this.name == "powtórz" && i < this.prog.length - 2) {
                                var parser = new Parser(findRepeat(this.prog, i));
                                this.coms = parser.parse();
                                this.jump = true;
                            }
                            this.tks.push(new Token(this.name, this.val, this.coms));
                            this.name = "";
                            this.val = "";
                            this.coms = [];
                            this.step = 0;
                            if (this.jump) {
                                this.jump = false;
                                this.id = findRepeatEnd(this.prog, i);
                            }
                        }
                        if (this.name.length > 0) {
                            this.step++;
                        }
                        if (this.check) {
                            this.step = 0;
                            this.check = false;
                        }
                    }
                    if (this.step == 0) {
                        if (this.prog[this.id] != '[' && this.prog[this.id] != ']' && this.prog[this.id] != ' ') {
                            this.name += this.prog[this.id];
                        }
                    } else {
                        if (!this.prog[this.id].isNaN) {
                            if (this.prog[this.id] != '[' && this.prog[this.id] != ']' && this.prog[this.id] != ' ') {
                                this.val += this.prog[this.id];
                            }
                        } else {
                            this.id--;
                            this.check = true;
                        }
                    }
                    this.id++;
                }
                return this.tks;
            }

            Parser.prototype.execute = function (prog) {
                for (var i = 0;i < prog.length;i++) {
                    if (prog[i].name == "naprzód") {
                        turtle.update(Number(prog[i].value));
                    } else if (prog[i].name == "wstecz") {
                        turtle.update(-1 * Number(prog[i].value));
                    } else if (prog[i].name == "lewo") {
                        turtle.changeAngle(Number(prog[i].value));
                    } else if (prog[i].name == "prawo") {
                        turtle.changeAngle(-1 * Number(prog[i].value));
                    } else if (prog[i].name == "podnieś") {
                        turtle.pen = false;
                    } else if (prog[i].name == "upuść") {
                        turtle.pen = true;
                    } else if (prog[i].name == "powtórz") {
                        var parser = new Parser(prog[i].commands);
                        for (var j = 0;j < prog[i].value;j++) {
                            parser.execute(parser.prog);
                        }
                    }
                }
            }
